✨ NEW IN #YEG ✨

@bellinscona is the newest brewery, taproom, & event space on Whyte Ave. They’re the sister company of @blowersgrafton — you can eat, drink, chill, and book up the spaces for events. There’s also a “Prairies Powder Room” on the main floor which we thought was very cleaver! 

I was invited to check it out with my friends (@mshangryfoodie, @thatsreallyjen, & @antonatienza), and it was such a lovely time catching up! The table favourite was the bannock tacos w/ braised beef. Flavour and texture was on pointtt 🤌🌮
